function initMap() {

    if(document.getElementById('startup_map') == null){
        return;
    }

    var myLatLng = {lat: -31.88147, lng: -52.272032999999965};

    mapValley = new google.maps.Map(document.getElementById('startup_map'), {
        zoom: 10,
        center: myLatLng
    });

    updateCandyMap()


}
